import axios from 'axios';
import React from 'react';

function Adil() {
 const [Drinks, setDrinksCards] = React.useState([])
  

  React.useEffect(() => {
    axios
    .get('https://demo5518646.mockable.io/DrinksCard')
    .then((res) => {
      const data = res.data.card; // Извлекаем массив данных
      setDrinksCards(data);
    })
    .catch((error) => {
      console.error("Ошибка при получении данных:", error);
    });
}, []);
 
  return (
    <div>
      {Drinks.map(card => (
        <div><h1>{card.price}</h1></div>
        ))}
    </div>
  )
}

export default Adil
